    def get_real_population_from_indicative_population(self,indicative_pop:np.ndarray):

        #create matrix of same shape 
        shape_of_indicative_pop = indicative_pop.shape
        real_paths_population = np.empty((shape_of_indicative_pop[0], shape_of_indicative_pop[1]), dtype=object)

        #for each individual
        for idx_individual,individual in enumerate(indicative_pop):
            #for each path
            for idx_path,path in enumerate(individual):
                new_real_path = []

                #for each node of the path
                for i in range(len(path)):
                    #we retrieve the actual node and the following one 
                    origin, destination = path[i],path[(i+1) % len(path)]

                    #if the origin node and the destination node is the same, there's no movement                     
                    if origin == destination :
                        continue
                    else:
                    #retrieving the path between the 2 nodes
                        shortest_path = list(self.shortest_way_matrix[origin][destination])
        
                    #when the part of the path to add to the final path is the first
                    if new_real_path == []:

                        #if it is a direct link between the 2 nodes
                        if shortest_path[1:-1] == []:
                            #we add both nodes
                            new_real_path.extend([shortest_path[0], shortest_path[-1]])
                        else:
                            #we add the first, the intermediates and the last node
                            new_real_path.extend([shortest_path[0], shortest_path[1:-1],shortest_path[-1]])
                    else:
                        #in this case, we only add the last node of the path (which is the destination node) because the origin was already added at the last "extend" call (depending where it was called)
                        if shortest_path[1:-1] == []:
                            new_real_path.extend([shortest_path[-1]])
                        else:
                            #same as before, we add everything except the first node (already added)
                            new_real_path.extend([shortest_path[1:-1],shortest_path[-1]])

                #removing the last node of the path as it's containing the initial node of the path ( ex: if the path begins with "0", the last node is "0")
                #as we consider that between the last node of the path and the first there is a direct path, we need to remove the last node
                new_real_path.pop()
                
                #setting the real_path
                real_paths_population[idx_individual][idx_path] = new_real_path
        
        return real_paths_population

    '''
    WORKS! 
    '''
    def mean_node_occurrence_computing(self,individual,type_pop):
        list_of_occurrences = []
        flattened_individual = []

        if type_pop == "real":
            #creating the "flat" version of the individual, so we can use "np.nonzero on it"
            for path in individual:
                for node in path:
                    if isinstance(node, list):  #if the current node is the list of the intermediate paths from node a to b
                        flattened_individual.extend(node)
                    else:  #if not, we append it 
                        flattened_individual.append(node)
                
        #for each node of the graph, we compute the occurrence
        for node in self.nodes_idx_list:
            
            #according to the type of population the function it is called with, we use the appropriate list 
            if type_pop == "real":
                #we count it's occurrence in the individual using the flattened list
                occurrences = np.count_nonzero(flattened_individual == node)
                list_of_occurrences.append(occurrences)
            else:
                #we count it's occurrence in the individual
                occurrences = np.count_nonzero(individual == node)
                list_of_occurrences.append(occurrences)

        #then we compute the mean occurrence of the nodes in the individual
        mean_node_occurrence = np.mean(list_of_occurrences)
        
        return mean_node_occurrence

    '''
    WORKS!
    '''
    def mean_path_lengths_computing(self,individual):
        
        path_lengths = []

        #for each path of the individual
        for path in individual:
            #we append the length of the whole path
            path_lengths.append(self.path_lengths_computing(path,self.distance_matrix))

        #then we coompute the mean length of the paths
        path_length_mean = np.mean(path_lengths)
        return path_length_mean 


    '''
    WORKS / voir quelle valeur (node occurrence ou path length) est la plus importnte des 2, pour adapter les alpha/beta en fonction 
    la meilleure fitness est la + PETITE

    => parrallélisable ! 
    '''
    def fitness_calculation(self):
        
        #influence factors for the values which are used to compute the fitness
        alpha = 1
        beta = 1

        fitness_lst = []
        type_of_individual = "real"

        for indicative_individual, real_individual in zip(self.indicative_paths_population, self.real_paths_population):

            #if the individual is valid
            if self.are_all_nodes_visited(indicative_individual):
                
                #we compute it's mean node recurrence using the real paths
                mean_node_occurrence = self.mean_node_occurrence_computing(real_individual,type_of_individual)
                #and the mean path length using the indicative population ( would've given the same value if we used the real paths instead)
                mean_path_length = self.mean_path_lengths_computing(indicative_individual)

                #computing the fitness itself
                fitness_value = alpha * mean_node_occurrence + beta * mean_path_length
                
            #if he's not, we apply the worst possible fitness to him
            else:   
                #in our case, we give it +infinite
                fitness_value = float('inf')
                pass
            
            #we append the fitness to a list of all the fitnesses of the population 
            fitness_lst.append(fitness_value)
        
        return fitness_lst

    '''
    WORKS 
    '''
    def selection(self,fitness,nb_parent):
        #creating an array which be used to store the parents, shape is : list of individuals (like the population)
        parents = np.empty((nb_parent,self.indicative_paths_population.shape[1], self.indicative_paths_population.shape[2]))  
        
        for i in range(nb_parent):
            #retrieving the location where the best fitness is 
            idx_max_fitness = np.where(fitness == np.min(fitness))
            parents[i] = self.indicative_paths_population[idx_max_fitness[0][0], :]
            #declaring the added individual as already taken by setting its fitness to a big value ( here 999999 as an example)
            fitness[idx_max_fitness[0][0]] = 999999
        
        return parents.astype(int)


    '''
    WORKS
    => parrallélisable ! (probablement)
    '''
    def crossing(self,parents, nb_enfant):
       
        #matrix of same shape
        children = np.empty((nb_enfant,parents.shape[1],parents.shape[2])) 

        number_of_crossing_points = 2 #we cut in 2 parts atm

        #probability of crossing the parents
        taux_de_croisement = 0.8
        i = 0

        while (i < nb_enfant):  
            
            #probability of steril parent
            x = rd.random()
            if x > taux_de_croisement:  
                continue
            #randomly choosing the 2 individuals to cross together
            first_individual_to_cross = rd.randint(0,len(parents)-1)
            second_individual_to_cross = rd.randint(0,len(parents)-1)

            #assuring we don't choose the same individual twice (no point doing that when crossing)
            while first_individual_to_cross == second_individual_to_cross:
                second_individual_to_cross = rd.randint(0,len(parents)-1)
            #print("ICI")
            #getting the parents
            parent1 = parents[first_individual_to_cross]
            parent2 = parents[second_individual_to_cross]

            #get the 2 created children
            created_children = list(self.horizontal_crossing_process(parent1,parent2, number_of_crossing_points))
            
            for child in created_children:
                #print("child",child)
                if self.are_all_nodes_visited(child):
                    #print(children[i])
                    children[i] = child
                    #print(children[i])
                    #print("---")
                    i+=1

                    if i == nb_enfant:
                        break
                    
        return children.astype(int)
         
    '''
    WORKS ! 
    '''
    #crosses 2 parents by cutting horizontally 
    def horizontal_crossing_process(self,parent_1,parent_2,nb_crossings):
            
        #cutting the first individual horizontally according to the number of crossing we have to get
        sub_matrices_first_individual = np.array_split(parent_1, nb_crossings, axis=1)  
            
        #cutting the second individual horizontally according to the number of crossing we have to get
        sub_matrices_second_individual = np.array_split(parent_2, nb_crossings, axis = 1)  
            
        temp_child_1 = []  
        temp_child_2 = []  

        #reassembling the children using an alternating pattern 
        for i in range(nb_crossings):
            if i % 2 == 0:  # even index 
                temp_child_1.append(sub_matrices_first_individual[i])
                temp_child_2.append(sub_matrices_second_individual[i])
            else:  # odd index
                temp_child_1.append(sub_matrices_second_individual[i])
                temp_child_2.append(sub_matrices_first_individual[i])

        #merging to get the children
        first_children = np.hstack(temp_child_1)
        second_children = np.hstack(temp_child_2)
        
        return first_children, second_children

    '''
    WORKS
    => parrallélisable ! (certainement)
    '''
    def mutating(self,enfants):
        
        #matrix of same shape
        mutants = np.zeros((enfants.shape))

        #probability of mutating the child
        taux_mutation = 0.5

        #for each child
        for i in range(mutants.shape[0]):
            
            #probability of mutating
            random_value = rd.random()
            if random_value > taux_mutation:
                #continue
                pass
                
            #generate a random value associated for deciding which path will be mutated
            idx_col_to_shuffle = rd.randint(0,mutants.shape[1]-1)

            #we reverse the right path of the child
            enfants[i][idx_col_to_shuffle] = np.flip(enfants[i][idx_col_to_shuffle])
            #we add the child to the mutants output
            mutants[i] = enfants[i]

        return mutants.astype(int)


    '''
    WORKS
    this function is used because a real path is sorted like following: [node_1,[list of nodes to travel to get from node_1 to node_2], node_2,...]
    It is used right before returning the result of the algorithm so that he app can, in fact, use the result of this algorithm.

    => maybe à parralléliser ?
    '''
    def flatten_result_path(self,path):
        result = []
        for item in path:
            #if the current item is a list
            if isinstance(item, list): 
                #recursiv call to flatten the item(list) into a sequence of elements in the path
                result.extend(self.flatten_result_path(item)) 
            else:
                #otherwise, we just append the element as it is only a node
                result.append(item) 
        
        #we return the flattened path ( a typical python list or ndarray)
        return result

    def run_genetics_algorithm(self):

        #generating the initial population
        self.indicative_paths_population = self.initial_population_generation_V2()
        self.real_paths_population = self.get_real_population_from_indicative_population(self.indicative_paths_population)

        #declaring the number of parents and thus, the number of children
        nbr_parents = self.nb_individuals_in_pop // 2
        nbr_enfants = self.nb_individuals_in_pop - nbr_parents

        for _ in range(self.nb_generations):
            
                #evaluating the fitness of the current population
            fitness = self.fitness_calculation()
                #---for testing
            if _ == 0:
                print("fitness initiale\n",fitness)
            #print("iter ",_)
                #---
                #selecting the best individuals to use them as parents
            parents = self.selection(fitness,nbr_parents)
            #print("paretns OK")
                #crossing the parents to get children
            children = self.crossing(parents, nbr_enfants)
                #mutating the children to get mutants
            #print("enfnats OK")
            mutants = self.mutating(children)
            #print("mutants OK")
                # updating the "indicative" population
            self.indicative_paths_population[0:parents.shape[0], :] = parents  
            self.indicative_paths_population[parents.shape[0]:, :] = mutants

            #at the end, we update the real_path_population to get the final "real" results of the algorithm
            new_real_population = self.get_real_population_from_indicative_population(self.indicative_paths_population)
            self.real_paths_population = new_real_population

        #evaluating the fitness of the final population
        fitness_finale = self.fitness_calculation()
        print(fitness_finale)
        #retrieving the optimal fitness of the population
        optimal_fitness = np.where(fitness_finale == np.min(fitness_finale))[0][0]

        #getting the associated individual from the indicative population
        res_of_algo = self.indicative_paths_population[optimal_fitness]

        #flattening the individual so he's usable when we return him
        algorithm_output = []
        for elem in res_of_algo:
            algorithm_output.append(self.flatten_result_path(elem))

        #print("res algo\n",algorithm_output)
        
        return algorithm_output
        
       

